branchCategory.description:
&lt;p&gt;
The MGCL integrates a round body cylinder for its power source with external guide rods to isolate the load bearing from the movement of the actuator&apos;s rod and seals for a compact and light weight unit. The high precision ball bushing allows for smooth operation that ensures stable travel resistance. It is designed with air cushions at the end of stroke for maximum kinetic energy absorption. Non-rotating accuracy ranging from +/-0.04&#xb0; for 50 mm bore to +/-0.07&#xb0; for 20 mm bore. Air cushions as standard.
&lt;/p&gt;

branchCategory.bullets:
&lt;ul&gt;
&lt;li&gt;Bore sizes: 20, 25, 32, 40, 50 mm&lt;/li&gt;
&lt;li&gt;Available in basic or front flange mounting&lt;/li&gt;
&lt;li&gt;Adjustable stroke option, extent cycle (XC8)&lt;/li&gt;
&lt;li&gt;Adjustable stroke option, retract cycle (XC9)&lt;/li&gt;
&lt;li&gt;Dual stroke option, single rod (XC11)&lt;/li&gt;
&lt;li&gt;Auto switch capable&lt;/li&gt;
&lt;/ul&gt;

